script: |
  super -f text -I q1123.spq | sort > q1123.out

inputs:
  - name: q1123.spq
    data: |
      SELECT DISTINCT + + cor0.col1 * + 76 AS col0 FROM tab2 (FORMAT parquet) AS cor0 CROSS JOIN tab1 (FORMAT parquet), tab0 (FORMAT parquet) AS cor1, tab0 (FORMAT parquet), tab0 (FORMAT parquet) AS cor2;
  - name: tab0
  - name: tab1
  - name: tab2

outputs:
  - name: q1123.out
    data: |
      1292
      2356
      4484
